import { useState } from "react";
import "./App.css";


function App() {
  const [selectedModel, setSelectedModel] = useState('All detection models');
  const [selectedDate, setSelectedDate] = useState('16 Jul');

  const handleModelChange = (e) => {
    setSelectedModel(e.target.value);
  };

  const handleDateSelection = (date) => {
    setSelectedDate(date);
  };
